(31, 5641, 'Dr.', 'RAJARAMAN R ', 'MSG', 'MSG', 'MPD', 'MPS', 'rraman@igcar.gov.in', 'MSG/MPD/MPS', 'Hardware', 'Scanning ProbeMicroscope', 'MRPU/01/MIA/6857/PO/114394/FE', '2016-01-01', 124, 0, '124', 'Yes', '', 'No', 'P106 / UGC-DAE centre', 5641, 'Dr. RAJARAMAN R ', 'rraman@igcar.gov.in', '22776', '                      Surface characterization of novel materials and thin film coatings.                                                                   ', '              ', '                                                                                                                                                                                                      This spectrometer was setup at UGC-DAE CSR, Kalpakkam node, Kokilamedu and utilized to the research activities of students and research scholars coming to UGC-DAE CSR Kalpakkam node and research groups of IGCAR & BARC facilities of Kalpakkam\r\n	Studies on obliquely deposited textured thin films of Co, Fe, Indium  sulphide and  antimony sulphide, grown on silicon substrate using AFM   and MFM. (UGC)\r\n	Studies on irradiated and unirradiated fullerene using AFM and MFM (UGC)\r\n	Studies on  morphology of graphene oxide layers using AFM. (UGC)\r\n	Studies on Si PIN diodes (MSG)\r\n                                                                                                              ', '                                                                                                                                                                                                      -                                                                                                              ', '10', 'No', '                                                                                                    ', '20', '20', '          ', 'No', ' -', '                      UGC-DAE \r\n', '                                                           -                                        ', 'No', '                                                -                                                   ', 'No', '                            -                                                                       ', 'No', '                                         -                                                          ', 'No', '', '                                                                                                    ', 'Yes', '                                                                                               ', '                                                                                                                                                                                -                                                                                        ', '                   Manpower\r\nAMC\r\n                                                                                                                                                                                                                                                              ', 'MSG', '2022-02-18 10:24:06', 0),
(32, 10179, 'Shri', 'ANINDYA BHATTACHARYYA', 'EIG', 'RCIG', 'RTSD', 'CSDS', 'anindya@igcar.gov.in', 'EIG/RCIG/RTSD/CSDS', 'Hardware', 'Highly Accelerated Life Testing Facility', 'MRPU/IGCAR/FAB/2125/PO/120618 IGC/3342/EQPT', '2019-01-01', 192, 0, '192', 'No', 'AMC', 'No', 'RTSD / EIG', 10179, 'Shri ANINDYA BHATTACHARYYA', 'anindya@igcar.gov.in', '22872', '  In order to make the I&C designs targeted for reactor applications more rugged, it is necessary to eliminate weak links which would in later stages manifest itself in the form of faults .This is best done during the design and development stages using well proven techniques like Highly Accelerated Life Testing (HALT)  & Highly Accelerated Stress Screens (HASS) . HALT is used to find the weak links of a product during the design phase itself, thereby providing valuable feedback to the designer regarding the first failure modes of the design. HALT is performed by subjecting the Design Under Test (DUT) to extreme environment which primarily consist of vibration shocks and thermal cycling. The stresses are not meant to simulate the field environments at all but to find the weaklinks in the design and processes using only a few units and in a very short period of time. The stresses are stepped up well beyond the expected field environment in order to reduce the time to find the latent fault in the design and making the product more reliable and rugged for deployment in harsh environment. Highly Accelerated Stress Screens (HASS) uses accelerated stresses (beyond product specifications and as determined appropriate during HALT) to detect product defects during manufacturing processes. The accelerated stresses of the HASS program shorten the time to failure of defective units and therefore shorten the corrective action time and the number of field returns with similar flaws.       ', '', '                  •	Uncovering weakness in a design which are not found during traditional qualification testing, hence making the design rugged\r\n•	Evaluation of product safety limit and destruction limit for optimum field usage\r\n•	Investigations into the failure modes of the key components and analysis of root cause\r\n•	To uncover faults due to faulty manufacturing processes\r\n•	To quantify reliability of a system/components\r\n•	Screening of third party commercially  off the shelf designs\r\n          ', '                  -          ', 'Each Sampl', 'No', '                  -          ', '3 samples/', 'Each Sampl', '  -', 'No', '', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'Yes', '                    -            ', 'No', '', '                -        ', 'No', '        No. Not Av        ', '                -        ', '                  The equipment uses Liquid Nitrogen as a consumable for accelerated cooling purposes. Each run consumes approximately 1000 litres. For maximum utilization the procurement for LN2 can be made simpler which would streamline the usage          ', 'EIG', '2022-02-18 11:19:41', 0),
(35, 6222, 'Shri', 'SUJOY SEN ', 'MSG', 'MSG', 'MPD', 'IBPS', 'sujoy@igcar.gov.in', 'IGCAR/MSG/01', 'Hardware', 'Integrated AFM-RAMAN system', 'MRPU/01/CAP/8549/PO/115338/FE', '2016-07-07', 173, 0, '173', 'Yes', '', 'No', 'PIF building, MSG', 6222, 'Shri SUJOY SEN ', 'sujoy@igcar.gov.in', '22833', '   Integrated Raman AFM system incorporates the features of the Raman spectroscopy & microscopy system (alpha300R) for chemical imaging along with Atomic Force Microscopy (alpha300 A) for high-resolution nanoscale surface characterization.         ', '', '                           •	Optical and acoustic Raman spectroscopy with spectral imaging for various materials characterizations. \r\n•	Photoluminescence spectroscopy to characterize defects in semiconductors & insulators.\r\n•	AFM to characterize ion-beam modified samples and to study surface patterning.                ', '                           -               ', '1', 'No', '                                          ', '20', '2', '   ', 'No', '', '   Yes', '                           -               ', 'Yes', '                                                ', 'Yes', '                                                ', 'Yes', '                                                ', 'No', '', '                                    ', 'No', '                                    ', '                        -            ', '                           Availability of manpower to increase utilization               ', 'MSG', '2022-02-21 05:32:23', 0),
