(52, 6746, 'Shri', 'MATCHA NANI BABU ', 'MMG', 'MEG', 'MDTD', 'MMS', 'nanibm@igcar.gov.in', 'MMG/MEG/MDTD/MMS2', 'Hardware', 'Fatigue crack test system of 100 kN testing capacity (2 numbers)', 'MRPU/01 /ENG/4764/118516/PO/115370/FE', '2017-01-01', 580, 0, '300', 'Yes', 'AMC', 'No', 'MDL building, Room # 124', 6746, 'Shri MATCHA NANI BABU ', 'nanibm@igcar.gov.in', '21552', '     100kN Capacity servo hydraulic testing machine with high temperature furnace and DCPD attachment for measurement of crack growth rates under cyclic loading               ', '', '                                             •	Establishing the crack growth rates da/dNvsK curves as per ASTM 647 standard                         ', '                                             -                         ', '15', 'No', '                                                                      ', '25', '2', '     -', 'Yes', '', '     MMS/MDTD', '                                             -                         ', 'No', '                                                  -                              ', 'No', '                                                  -                              ', 'No', '                                                  -                              ', 'No', '', '                                        -                    ', 'No', '                                        -                    ', '                                        -                    ', '                                             Proper planning of tests well in advance is suggested                          ', 'MMG', '2022-02-21 08:55:55', 0),
(53, 6746, 'Shri', 'MATCHA NANI BABU ', 'MMG', 'MEG', 'MDTD', 'MMS', 'nanibm@igcar.gov.in', 'MMG/MEG/MDTD/MMS3', 'Hardware', 'Pre-cracking test facility for CT', 'MRPU/AUSC/CAP/9272/PO-18', '2019-01-01', 300, 0, '370', 'Yes', '-', 'No', 'IFFRM building, Room # 112', 6746, 'Shri MATCHA NANI BABU ', 'nanibm@igcar.gov.in', '21552', '    50 and 100 kN capacity testing machines for precraking of verities of fracture mechanics samples such as CT for CCG, FCG and Fracture, TPB, Charpy for fracture studies and Fatigue crack growth testing at high frequency            ', '', '                                    •	Pre-cracking to determine resistance to crack growth rates under cyclic  loading as per ASTM 647 standard\r\n•	Pre-cracking to determine fracture toughness determination under quasi-static loading as per ASTM 1820 standard\r\n                    ', '                                    -                    ', '2', 'No', '               -                                         ', '25', '10', '    -', 'No', '-', 'Yes, MMS/MDTD', '                                    -                    ', 'No', '                                        -                        ', 'No', '                                        -                        ', 'No', '                                        -                        ', 'No', '', '                                 -               ', 'No', '                   -                             ', '                                -                ', '                                    Prior planning of the required test is suggested                     ', 'MMG', '2022-02-21 09:34:03', 0),
(54, 5912, 'Smt', 'VANI SHANKAR ', 'MMG', 'MEG', 'MDTD', 'FSS', 'vani@igcar.gov.in', 'MMG/MDTD/FSS', 'Hardware', 'SEM-EDS-EBSD, SUPRA 55', 'PO: IGCAR/CAP/5865/TPT', '2013-01-01', 250, 0, '350', 'Yes', '-', 'No', 'Room No. 111, IFFRM Building', 5912, 'Smt VANI SHANKAR ', 'vani@igcar.gov.in', '21147', '   Scanning electron microscope (SEM) is equipped with in-lens detector, Energy Dispersive Spectroscopy (EDS), forescatter, secondary electron and Electron Back Scattered Diffraction detectors. The field emission gun provides resolution of 1 nm@20V, 1.3nm@15V, 2.1nm @1KV. The speciality of the system is that it can determine both the chemical composition and crystallographic information from the same location simultaneously.         ', '', '                           A. Scanning electron microscope (SEM)\r\n1)	Fractography/topography analysis\r\n2)	High mag. Imaging\r\n3)	Z based Back scattered imaging\r\nB. Energy Dispersive Spectroscopy (EDS)\r\nChemical composition\r\nC. Electron Back Scattered Diffraction\r\n1)	Crystallography based deformation studies \r\n2)	Texture, recrystallization, grain boundaries, strain analysis\r\nPhase transformation studies\r\n               ', '                           -               ', '12', 'No', '                                          ', '25', '10', '   -', 'No', '', ' PMD has one EBSD-EDS-SEM system and MSD has one SEM alone. RML and RCL have SEM with EDS alone. EBS', '                           -               ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '', '                                    ', 'No', '                        -            ', '                        -            ', '                           The equipment is a service-based, and throughout IGCAR it is already being utilized by many users, irrespective of their groups. It has an EBSD detector for carrying out crystallography based microstructural analysis. Long scans and large area mapping are usually done overnight. The equipment is well utilized.               ', 'MMG', '2022-02-21 10:11:57', 0),
(55, 6861, 'Shri', 'GANESH KUMAR J ', 'MMG', 'MEG', 'MDTD', 'CSS', 'ganeshkumarj@igcar.gov.in', 'MMG/MEG/MDTD/CSS', 'Hardware', 'Electromechanical Instrumented Creep Test Systems', 'MRPU/01/CAP/9248/PO/121207/FE ', '2018-01-01', 484, 0, '550', 'Yes', '-', 'No', 'MDL building Room No. 102', 6861, 'Shri GANESH KUMAR J ', 'ganeshkumarj@igcar.gov.in', '21081', '   The equipment is used to conduct stress relaxation and creep tests by measuring local strain distribution (in weld joints, notches) with in-built video extensometer.         ', '', '                           To evaluate stress relaxation and creep behaviour of AUSC and FBR materials and weld joints, under transient loading conditions, with in-situ mapping of local strain distribution.               ', '                           -               ', '1', 'No', '                                          ', '28', '10', '   -', 'No', '-', 'MMG/MDTD', '                           -               ', 'No', '                                                ', 'No', '                              -                  ', 'No', '                                                ', 'No', '', '                                    -', 'No', '                        -            ', '                        -            ', '                           Not applicable               ', 'MMG', '2022-02-21 10:27:12', 0),
(56, 6635, 'Dr.', 'DIPTIMAYEE SAMANTARAY ', 'MMG', 'MEG', 'MDTD', 'MFTS', 'deepsaroj@igcar.gov.in', 'MMG/MEG/MDTD/MFTS', 'Hardware', 'Confocal Laser Scanning Microscope Olympus LEXT OLS4100 non-contact 3D laser scanning digital micros', 'IGCAR/CAP/8043/PO/113747  dated 04/09/2015', '2015-01-01', 129, 0, '147', 'Yes', '-', 'No', 'Room no.224, MDL (building no:126)', 6635, 'Kum. DIPTIMAYEE SAMANTARAY ', 'deepsaroj@igcar.gov.in', '21158', '   Olympus LEXT OLS4100 is a laser scanning digital microscope for non-contact 3D observations and measurements of microscopic surface features. The OLS4100 industrial microscope has distinctive features for fast acquisition of images over a wider area. Itis capable of high speed scanning, fast processing speed and automated operation with software for the analysis of surfaces. It can acquire planar, three-dimensional images of surfaces in real colour.         ', '', '                           1.	Acquiring and processing 2D/3D micrographs.\r\n2.	Tint and polarised light microscopy for metallurgical phase identification.\r\n3.	Standard geometric analysis, including:\r\n•	Profile measurement\r\n•	Step height measurement\r\n•	Line roughness measurement\r\n•	Plane roughness measurement\r\n•	Geometric measurement\r\n•	Area/Volume measurement\r\n4.	Wear analysis of various materials.\r\n5.	Defect characteristion in welded and corroded components.\r\n6.	Crack geometry measurements.\r\n7.	Major and minor strain measurements for generating forming limit diagrams.\r\n\r\n               ', '                           -               ', '8', 'No', '                           -               ', '25', '20', '   -', 'No', '-', '   MMG/MEG/MDTD', '                           -               ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '', '                                    ', 'No', '                        -            ', '                        -            ', '                           Can be included in “Facilities of MDTD” in the IGCAR website for wide publicity               ', 'MMG', '2022-02-21 10:42:53', 0),
(57, 6072, 'Shri', 'CHITTA RANJAN DAS ', 'MMG', 'MEG', 'MDTD', 'MJS', 'chitta@igcar.gov.in', 'MMG/MEG/MDTD/MJS ', 'Hardware', 'NanoTest Vantage Alpha P5 with NTX5 Controller (up-gradation)', 'DPS/MRPU/1/6/2772/PO/1673 ', '2021-01-01', 996, 0, '996', 'Yes', '-', 'No', 'MMG/MEG/MDTD/MJS ', 6072, 'Shri CHITTA RANJAN DAS ', 'chitta@igcar.gov.in', '21215', '     This machine can be used to generate hardness data using nano load in all materials.               ', '', '                                             •	Evaluation of hardness data of secondary phases present in coating using nanolaod.\r\n•	Deformation behaviour of dissimilar weld interface.\r\n•	Deformation behaviour of precipitate free zone.\r\n•	Deformation behaviour of different hierarchical boundaries in steels.\r\n                         ', '                                             -                         ', '10', 'No', '                                                                      ', '0', '0', '     -', 'No', '', 'MSG and Physical metallurgy Division, MMG.', '                                             -                         ', 'No', '                                                  -                              ', 'No', '                                                  -                              ', 'No', '                                                  -                              ', 'No', '', '                                        -                    ', 'No', '                                        -                    ', '                                        -                    ', '                                             This facility can be open to anyone who is interested to nano hardness data.                         ', 'MMG', '2022-02-21 10:57:52', 0),
(58, 6072, 'Shri', 'CHITTA RANJAN DAS ', 'MMG', 'MEG', 'MDTD', 'MJS', 'chitta@igcar.gov.in', 'MMG/MEG/MDTD/MJS1', 'Hardware', 'Instrumented Hot Hardness Machine ', 'MRPU/01/CAP/9453/PO/27/FE ', '2019-01-01', 842, 0, '842', 'Yes', '-', 'No', 'Instrument to be installed in room number 113 of IFFRM building.', 6072, 'Shri CHITTA RANJAN DAS ', 'chitta@igcar.gov.in', '21215', '  This machine can be used to generate hot hardness data of all materials as a function of temperature till 800C.      ', '', '                  •	Hot hardness data of coating used in PFBR\r\n•	Hot hardness data of coating will be used in AUSC plant\r\n•	Hot hardness data of all bearing materials.\r\n•	High temperature deformation behaviour of weldments and interfaces.\r\n          ', '                  -          ', '8', 'Yes', '                  -          ', '0', '0', '  -', 'No', '-', 'Yes. This facility can be used by any group.', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                -        ', '                -        ', '                  This facility can be open to anyone who is interested to generate hot hardness data of materials for which performing full scale mechanical tests are difficult.          ', 'MMG', '2022-02-21 11:20:07', 0),
(67, 5559, 'Shri', 'CHANDRASEKHAR.N ', 'MMG', 'MEG', 'MDTD', 'MJS', 'nchandra@igcar.gov.in', 'MMG/MEG/MDTD/MJS 1', 'Hardware', 'Integrated robotic TIG welding system', 'MRAU/AUSC/CAP/9307/19', '2019-01-01', 133, 0, '133', 'Yes', '', 'No', 'Room No.123, welding laboratory at INSOT building', 5559, 'Shri CHANDRASEKHAR.N ', 'nchandra@igcar.gov.in', '21205 / 22938', '   This welding machine can be used for multiple purposes. It can be used for fabrication of all experimental weld joints. The main objective is to develop remote repair welding technique.         ', '', '                           •	To develop remote repair welding technology for FBR application\r\n•	Additive manufacturing\r\n               ', '                           -               ', '1', 'Yes', '                           -               ', '20', '30', '   -', 'No', '', '   Yes  QAD', '                           -               ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '                              -                  ', 'No', '', '                        -            ', 'No', '                        -            ', '                        -            ', '                           Collaborating with other R&D institutions and industries.               ', 'MMG', '2022-02-22 05:02:48', 0),
