(74, 6177, 'Shri', 'ARUP DASGUPTA DR ', 'MMG', '', 'PMD', '', 'arup@igcar.gov.in', 'MMG/PMD/SAMS', 'Hardware', 'Ultra High Resolution Analytical Transmission Electron Microscopy (UHRATEM) Facility (Declared as MRPU facility)', 'PO No: MRPU/01/MIA/7123/PO/121551/FE', '2019-01-01', 33, 0, '35', 'Yes', '', 'No', 'IFFRM building, Kokilamedu, Room No. 122', 6177, 'Shri ARUP DASGUPTA DR ', 'arup@igcar.gov.in', '22135', '  This is a state-of-the-art probe aberration-corrected scanning TEM with the facilities to perform the sub-Å resolution structure and chemical analysis eelectron microscopy and electron spectroscopy techniques, with the following specifications.\r\n•	Resolution in STEM (with probe-corrector): 53 pm\r\n•	Energy resolution in EELS (with monochromator):160meV\r\n•	EDS max counts: 820 kcps\r\n      ', '', '                  •	Structural and chemical characterization of nuclear materials at the sub-Å level for structural and reprocessing applications and directed basic research.\r\n•	Light atom (low atomic No.) imaging in structural materials, e.g., O, S, C and B in various materials\r\n•	In-situ studies of phase and structural transformation in ceramic and metallic systems\r\n•	Magnetic domain imaging using Lorentz microscopy\r\n•	3D tomography reconstruction of precipitates and secondary phases.\r\n          ', '                  -          ', '1', 'No', '                            ', '29', '10', '  -', 'No', '', 'This is declared as a MRPU facility. Samples with very special requirement in terms of resolution ar', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        -', 'No', '                        -', '                -        ', '                  Nil          ', 'MMG', '2022-02-22 06:37:27', 0),
