(77, 6177, 'Shri', 'ARUP DASGUPTA DR ', 'MMG', '', 'PMD', '', 'arup@igcar.gov.in', 'MMG/PMD/SAMS 2', 'Hardware', 'High Temperature XRD STOE Gmbh, Germany/ StadiMP Sr', 'PO No: MRPU/01 /CAP/9372/PO/24/FE', '2019-01-01', 330, 0, ' 330 ', 'Yes', '', 'No', 'IFFRM building, Kokilamedu, Room No. 220', 6177, 'Shri ARUP DASGUPTA DR ', 'arup@igcar.gov.in', '22135', '  This is a state-of-the-art X-ray diffraction unit with the capability to perform the diffraction analysis at high temperature. The main features of the unit is as follows,\r\n•	Max. operating temperature: 1000 °C\r\n•	Available X-ray sources: Cu, Co, and Mo\r\n      ', '', '                  •	XRD analysis of different nuclear materials in bulk as well in powder form for structural and reprocessing applications and also towards directed basic research\r\n•	In-situ studies of phase and structural transformation in different ceramic and metallic systems\r\n•	Texture analysis and GB engineering of different grades of steels and superalloys for nuclear applications\r\n          ', '                  -          ', '8', 'No', '                            ', '29', '20', '  -', 'No', '', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                        ', '                -        ', '                  -          ', 'MMG', '2022-02-22 07:16:51', 0),
