(80, 6801, 'Kum.', 'NEELIMA PRASANTHI THOTA ', 'MMG', '', 'PMD', 'CMMS', 'prashanti@igcar.gov.in', 'MMG/PMD/CMMS 1', 'Hardware', 'Electron Probe Micro Analyzer  Cameca, France & SX-FIVE EPMA ', 'MRPU/01/MIA/6236/PO/121138 ', '2018-01-01', 103, 0, '103', 'Yes', '', 'No', '119, MMG-2, IFFRM extn. Building', 6801, 'Kum. NEELIMA PRASANTHI THOTA ', 'prashanti@igcar.gov.in', '22134', '  EPMA is a technique to do accurate microchemical analysis on metallic specimens with a detection limit of 100 ppm for 9<Z<42 and 1000 ppm for 5<Z<9. It is equipped with three wavelength dispersive X-ray spectrometers. SE and BSE image analysis also can be carried out. Additionally, anti-contamination device is provided for accurate carbon analysis         ', '', '                  EPMA is an analytical equipment used for accurate microchemical analysis of solid metallic samples with a spatial resolution of 1-2 m. \r\no	Solid state interdiffusion across clad/simulated spent fuel\r\no	Solid state interdiffusion across Fe/Ti based dissimilar joints \r\no	Solid state interdiffusion across P91/Zr& D9/Zr systems\r\no	Microchemical characterization of materials manufactured through advanced processes like additive manufacturing, spark plasma sintering\r\no	Aluminization of ferritic and austenitic steels\r\n          ', '                  -          ', '4', 'No', '                            ', '25', '5', '  -', 'No', '-', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                        ', '                -        ', '                  -          ', 'MMG', '2022-02-22 07:48:06', 0),
