(86, 6231, 'Shri.', 'SUNDARAVEL B. DR. ', 'MSG', 'MSG', 'MPD', 'IBPS', 'bsundar@igcar.gov.in', 'MSG/MPD/IBPS', 'Hardware', 'High Resolution RBS System at +30o beam line HVEE, Netherlands, Customized ', 'MRPU/01/MIA/6339/PO/113314/FE', '2015-01-01', 269, 0, '350', 'Yes', '', 'No', 'Beam Hall, PIF building, 106 /140', 6231, 'Shri. SUNDARAVEL B. DR. ', 'bsundar@igcar.gov.in', '22924', ' It is a high resolution RBS detector comprising torroidal electrostatic analyser, Multichannel plates, 1D position sensitive detector and data collection systems installed in a high vacuum chamber coupled to +30o beam line of 1.7 MV tandetron.   ', '', '         	Ion beam analysis of ultra thin films with  2Å depth resolution and  improved mass resolution . \r\n	Cr-segregation in reactor materials\r\n	Ultra thin layers of  advanced  2D functional materials, MTJs, etc\r\n	Studies of Surface melting, Surface reconstruction, surface oxidation, Adsorption. \r\n     ', '         -     ', '10', 'No', '              ', '2', '1', ' -', 'No', '', ' -', '         -     ', 'No', '          -      ', 'No', '          -      ', 'No', '          -      ', 'No', '', '            ', 'No', '            ', '        -    ', '         Availability of beam time of the accelerator and manpower.     ', 'MMG', '2022-02-22 09:26:44', 0),
(88, 6222, 'Shri', 'SUJOY SEN ', 'MSG', 'MSG', 'MPD', 'IBPS', 'sujoy@igcar.gov.in', 'MSG/MPD/IBPS 1', 'Hardware', 'Optical absorption &Luminescence spectrometer   system. M/s. Edinburgh Instruments, UK; FLS 980-D2D2-st with fibre linking to sample chamber & ion irradiation vacuum chamber. ', 'PO No.MRPU/01/MIA/7156/PO/117692/FE', '2017-01-01', 193, 0, '225', 'Yes', '', 'No', '150 kV Accelerator Hall, PIF building, 140', 5107, 'Shri GANGOPADHYAY P. ', 'pganguly@igcar.gov.in', '21393', '  Optical absorption &luminescence spectrometer   system consisting of Xe lamp source, double monochromator, PMT detector, lifetime data collection system, integrating sphere for quantum efficiency measurements, fibre-coupled to the spectrometer & the ion irradiation vacuum chamber of 150 kV Accelerator.      ', '', '                  i.	in-situ studies of ion-beam induced optical absorption and luminescence in nuclear ceramics for characterizations of irradiation defects\r\nii.	luminescence lifetime measurements\r\niii.	band gap and quantum efficiency measurement\r\niv.	steady-state measurements of excitation and emission spectra of various materials \r\n          ', '                  -          ', '10', 'No', '                            ', '17', '1', '  -', 'No', '', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                        ', '                -        ', '                  Availability of manpower to increase utilization.          ', 'MMG', '2022-02-22 09:35:44', 0),
(90, 6762, 'Dr.', 'PADMAPRABHU C. ', 'MMG', 'MEG', 'PIED', 'FCS', 'prabu@igcar.gov.in', 'MMG/MEG/PIED/FCS', 'Hardware', 'Transmission Electron Microscope Carl Zeiss GmbH, Germany Model Libra 120 Plus', 'PO No.:101464 ', '2016-01-01', 518, 0, '720', 'Yes', '', 'No', 'RML-GA5', 6762, 'Dr. PADMAPRABHU C. ', 'prabu@igcar.gov.in', '26488', ' Energy Filtered Transmission Electron Microscope is a tool for nanometer scale microstructural characterisation of materials. It is having following features: \r\n•	In-column OMEGA energy filter\r\n•	Koehler Illumination System\r\n•	Automatic Illumination System (AIS)\r\n•	Acceleration Voltage between 80 and 120 Kv\r\n•	Point – Point Resolution: 0.34 nm; Information Limit: <0.20 nm; STEM resolution of <0.50 nm\r\n•	OMEGA spectrometer having Dispersion: 1.17 µm/eV @ 120 kV; Energy resolution: <1.5 eV; Distortion: < ±1.0%; Acceptance angle: 80 mrad at Δ = ±6 eV; Isochromaticity: <1.0 eV in 2.5 µm Ø\r\n•	Specimen Stage with 5-axes fully eucentric goniometer and α/β tilt: ±75° / ±30°\r\n•	Imaging System with 5 imaging lenses and OMEGA spectrometer having TEM  mode Magnification between 8 and 630kx; STEM mode magnification between 50 and 1,000kx; EELS magnification between 20 and 315x\r\n•	Image modes: EFTEM in Global and elastic BF/DF/Low Dose with elemental and structure sensitive contrast\r\n•	Analysis capabilities: EELS, ESI, Image EELS and EDS\r\n•	Diffraction modes: Global and elastic SAED, CBED and LACBED\r\n   ', '', '         Microstructural Characterisation of Irradiated Structural Materials     ', '         -     ', '15', 'No', '              ', '10', '1', ' -', 'No', '', ' -', '         -     ', 'No', '          -      ', 'No', '          -      ', 'No', '          -      ', 'No', '', '            ', 'No', '            ', '        -    ', '         -     ', 'MSG', '2022-02-22 10:06:05', 0);
