(96, 10179, 'Shri', 'ANINDYA BHATTACHARYYA', 'EIG', 'RCIG', 'RTSD', 'CSDS', 'anindya@igcar.gov.in', 'EIG/RCIG/RTSD/CSDS1', 'Hardware', 'System on Chip Emulation Facility Seimens Veloce 2 Quattro ', 'WO-IGC/EIG/RCCG/RTSD/CSDS/2019-20/WO-1 ', '2020-01-01', 323, 0, '323', 'Yes', '-', 'No', '-', 6410, 'Shri RAJENDRA PRASAD BEHERA ', 'rpb@igcar.gov.in', '22620', '  One of the major technical challenges for development of SoC is design verification which accounts for approximately 70% of engineering effort and prevents costly ASIC re-spins. Traditional simulation based verification falls short when simulating large designs and is extremely slow. Emulation is the process of imitating the behavior  of a hardware  with another piece of hardware, typically a special purpose emulation system. These systems are several times faster than the event based simulators which enables them to run actual software on the platform albeit at a lower rate of around 2-5 million cycles per second. This feature allows hardware software co-verification and full debugging visibility at system level and greatly  increases the confidence in the design. The proposed emulator platform  is intended to be used for system level functional verifications of the following       ', '', '                  	ABACUS based SoC for safety  applications \r\n	High performance ABACUS based SoC for networking and other  applications \r\n	68K  processor for VME bus based legacy applications\r\n	Any soft core processor based design\r\n	Any HDL based digital design verification \r\n          ', '                  -          ', '0', 'No', '                            ', '0', '0', '  -', 'No', '', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                        ', '                -        ', '                  -          ', 'MMG', '2022-02-22 10:26:32', 0),
(97, 6762, 'Dr.', 'PADMAPRABHU C. ', 'MMG', 'MEG', 'PIED', 'FCS', 'prabu@igcar.gov.in', 'MMG/MEG/PIED/FCS 1', 'Hardware', 'X-ray Diffractometer INEL SAS, France Model Equinox 3500', 'P.O.No.: 114316/FE (XRD); 114319 ', '2016-01-01', 140, 0, '162', 'Yes', '', 'No', 'RML-GA6', 6762, 'Dr. PADMAPRABHU C. ', 'prabu@igcar.gov.in', '26488', ' X-ray diffractometer system is a tool for analysis of crystal structure and secondary phase formed in the materials. It is having following major components: \r\n•	Monochromatic Cu-Kα X-ray source with focusing Multilayer Mirror optics\r\n•	Automatic motorized double micrometric slit in the range 0.1 to 10 mm with step size of 0.1mm.\r\n•	Goniometer with sample stage with θ rotation (resolution: 0.001°); X/Y/Z stage : resolution 1µm, 25mm range; Software module for Motion Control and sample alignment\r\n•	Laser distance sensor for sample positioning\r\n•	Curved linear position sensitive detector system for diffracted X-rays with Focusing radius: 500mm; Angular range : 90° 2θ; FWHM 0.05°; Angular reproducibility : +/- 0.001° 2θ\r\n•	Data acquisition and analysis systems  \r\n   ', '', '         Irradiation induced phase analysis of fast reactor fuel, structural and shielding materials     ', '         -     ', '1', 'No', '              ', '12', '1', ' -', 'No', '', ' -', '         -     ', 'No', '          -      ', 'No', '          -      ', 'No', '          -      ', 'No', '', '            ', 'No', '            ', '        -    ', '         -     ', 'ADMIN', '2022-02-22 10:28:36', 0),
(98, 5394, 'Shri', 'VENKITESWARAN C.N ', 'MMG', 'MEG', 'PIED', 'FCS', 'cnv@igcar.gov.in', 'MMG/MEG/PIED/FCS 2', 'Hardware', 'scanning Electron Microscope', 'MRPU/01/CAP/8547/PO/115358/FE ', '2016-01-01', 140, 0, '165', 'Yes', '', 'No', 'RML-GA6', 5394, 'Shri VENKITESWARAN C.N ', 'cnv@igcar.gov.in', '26453', '  SEM at PIED is 30kV, LaB6 electron gun with image resolution of 2nm, equipped with secondary and back-scattered electron detectors for imaging, and an X-ray WDS detector for micro-analysis. The SEM has been interfaced with shielded glove box (GB) to enable handling of alpha active samples, with provisions for alpha-tight transfer of specimens and inert atmosphere ventilation for handling of reactive specimens. The equipment will be shortly upgraded with radiation tolerant back-scattered detector and customized X-EDS detector for handling radioactive samples.      ', '', '                  SEM at PIED is 30kV, LaB6 electron gun with image resolution of 2nm, equipped with secondary and back-scattered electron detectors for imaging, and an X-ray WDS detector for micro-analysis. The SEM has been interfaced with shielded glove box (GB) to enable handling of alpha active samples, with provisions for alpha-tight transfer of specimens and inert atmosphere ventilation for handling of reactive specimens. The equipment will be shortly upgraded with radiation tolerant back-scattered detector and customized X-EDS detector for handling radioactive samples.          ', '                  -          ', '6', 'No', '                            ', '12', '10', '  -', 'No', '', '  -', '                  -          ', 'No', '                    -            ', 'No', '                    -            ', 'No', '                    -            ', 'No', '', '                        ', 'No', '                        ', '                -        ', '                  Indicated under S.No. 13.          ', 'ADMIN', '2022-02-22 10:36:20', 0),
