(101, 10524, 'Shri', 'DHAYALAN R', 'MMG', 'MEG', 'NDED', 'UMS', 'dhayalanr@igcar.gov.in', 'MMG/NDED/UMS', 'Hardware', 'Portable EMAT system', 'MRPU/01/ECON/3281', '2016-01-01', 211, 0, '261', 'Yes', '', 'No', 'ANDE Building, Room No. F21, EMAT –MBN Laboratory', 5822, 'Shri ANISH KUMAR ', 'anish@igcar.gov.in', '23603', ' The EMAT system and associated transducer coils/magnet can be used to generate different ultrasonic modes in couplant free manner. As compared to a single EMAT, the phased array EMAT ultrasonic system provides multiple angle inspection through electronic beam steering.   ', '', '         To explore the applicability of couplant free ultrasonic inspection of different weld joints in components of FBR and associated fuel cycle including the following:\r\n•	ISI of tri-junction weld in main vessel using SH wave phased array EMAT\r\n•	ISI of connecting shell weld in core support structure using SH guided waves\r\n•	ISI of dissimilar weld using angle beam SV wave EMAT\r\n•	Research and development of different types of high temperature EMATs for various reactor components\r\n     ', '         -     ', '3', 'No', '              ', '23', '0', ' -', 'No', '', ' -', '         -     ', 'No', '          -      ', 'No', '          -      ', 'No', '          -      ', 'No', '', '            ', 'No', '            ', '        -    ', '         NIL     ', 'MMG', '2022-02-22 10:56:09', 0),
