(118, 6447, 'Shri', 'BALAKRISHNAN S ', 'MC&MFCG', 'FMCG', 'FChD', 'AFSS', 'balakrish@igcar.gov.in', 'MC&MFCG/FChD/AFSS', 'Hardware', 'TG-DTA-MS equipment from M/s. NETZSCH GmbH', 'MRPU/MIA/6201/PO/110187 ', '2014-01-01', 164, 0, '164', 'Yes', '', 'No', 'N-9 lab outside the glove box', 6447, 'Shri BALAKRISHNAN S ', 'balakrish@igcar.gov.in', '24024 / 24063 / 24137', 'TG measures the change in sample weight as a function of temperature (and/or time) under controlled gas atmosphere. DTA is a popular thermo-analytical technique and is often usedto measure the temperature of a material, which in turn is used to measure the endothermic and exothermic phase transitions of material.', '', '	Measurement of melting point\r\n	Measurement of phase transition temperature\r\n	Measurement of glass transition temperature\r\n	Crystalline evaluation\r\n	Measurement of moisture/ volatile content\r\n	Investigation of thermal and oxidative stability\r\n	Purity checking\r\n', '-', '5', 'No', '', '25', '40', '-', 'No', '', 'TG-DTA, Dilatometer and the High Temperature High Vacuum Furnace are being used mainly for R&D activ', '-', 'No', '-', 'No', '-', 'No', '-', 'No', NULL, '', 'Yes', 'TG-DTA and dilatometer are available in MMG. However high temperature high vacuum split type furnace', '-', 'Scientists and scholars from other groups can employ the facility based on the requirements', 'MCMFCG', '2022-02-25 06:38:05', 0),
(119, 6447, 'Shri', 'BALAKRISHNAN S ', 'MC&MFCG', 'FMCG', 'FChD', 'AFSS', 'balakrish@igcar.gov.in', 'MC&MFCG/FChD/AFSS 1', 'Hardware', 'Dilatometer from M/s. NETZSCH GmbH', 'MRPU/MIA/6200/PO/110800 ', '2014-01-01', 102, 0, '102', 'Yes', '', 'No', 'N-9 lab outside the glove box', 6447, 'Shri BALAKRISHNAN S ', 'balakrish@igcar.gov.in', '24024 / 24063 / 24137', 'Dilatometer is a instrument for the measurement of dimensional changes of materials precisely as a function of temperature. Dilatometry can be used to test a wide range of materialssuch as ceramics, glasses, metals, alloys and polymers.', '', '	Thermal expansion measurements \r\n	Measurement of phase transition temperature\r\n', '-', '5', 'No', '', '25', '15', '-', 'No', '', 'TG-DTA, Dilatometer and the High Temperature High Vacuum Furnace are being used mainly for R&D activ', '-', 'No', '-', 'No', '-', 'No', '-', 'No', NULL, '', 'Yes', 'TG-DTA and dilatometer are available in MMG. However high temperature high vacuum split type furnace', '-', 'Scientists and scholars from other groups can employ the facility based on the requirements', 'MCMFCG', '2022-02-25 08:18:29', 0),
(120, 6447, 'Shri', 'BALAKRISHNAN S ', 'MC&MFCG', 'FMCG', 'FChD', 'AFSS', 'balakrish@igcar.gov.in', 'MC&MFCG/FChD/AFSS 2', 'Hardware', 'High Temperature High Vacuum Split type Furnace ', 'MRPU/IGCAR/FAB/1743/PO/113584  ', '2015-01-01', 138, 0, '138', 'Yes', '', 'No', 'N-7 lab inside glove box', 6447, 'Shri BALAKRISHNAN S ', 'balakrish@igcar.gov.in', '24024 / 24063 / 24137', '	Sintering of nuclear ceramics at elevated temperature under inert atmosphere\r\n	Annealing of alloys at high temperature under high vacuum\r\n', '', 'High temperature high vacuum furnace is being used for sintering of UREO2 samples, UO2 pellets, annealing of different high entropy alloys, sintering of yttria cups etc.\r\nApproximately 5-10 samples are being analysed per month depending on the requirement.\r\n', '-', '5', 'No', '', '18', '10', '-', 'No', '', 'TG-DTA, Dilatometer and the High Temperature High Vacuum Furnace are being used mainly for R&D activ', '-', 'No', '-', 'No', '-', 'No', '-', 'No', '', '', 'Yes', 'TG-DTA and dilatometer are available in MMG. However high temperature high vacuum split type furnace', '-', 'Scientists and scholars from other groups can employ the facility based on the requirements', 'MCMFCG', '2022-02-25 08:53:02', 0),
(121, 5839, 'Shri', 'VENKATESAN K A ', 'RpG', '', 'RRDD', '', 'kavenkat@igcar.gov.in', 'RpG/RRDD', 'Hardware', 'NANO-INXIDER SW MODEL', 'MRPU/01 /CAP/9263/PO/122449/FE', '2016-01-01', 250, 0, '250', 'Yes', '', 'No', 'RRDD Annex building, Ground Floor', 5839, 'Shri VENKATESAN K A ', 'kavenkat@igcar.gov.in', '22631, 26857', 'Small angle X-ray scattering instrument.', '', 'Determination of nanoscale particle size distribution, Size and shape of macromolecules, pore size distribution.  ', '-', '30', 'No', '', '0', '0', '-', 'No', '', 'RRDD/ RpG', '-', 'No', '-', 'No', '-', 'No', '-', 'No', NULL, '', 'No', '', '-', 'A dedicated operator and maintenance (Scientific assistant) personnel is required for the maximum utilization of the instrument.', 'ADMIN', '2022-02-25 09:24:32', 0),
(122, 6882, 'Dr.', 'MANISH CHANDRA ', 'MC&MFCG', 'MFRG', 'PPED', 'PESS', 'mchd@igcar.gov.in', 'MC&MFCG/PPED/PESS', 'Hardware', 'Focussed Ion Beam Scanning Electron Microscope', 'MRPU/01/CAP/8611/118792', '2017-01-01', 604, 0, '604', 'Yes', '', 'No', 'Lab H3, RCL', 6882, 'Dr. MANISH CHANDRA ', 'mchd@igcar.gov.in', '24025, 24020, 24170, 24283', 'Instrument consists of computer controlled combined Focused Ion Beam (FIB) and Scanning Electron Microscope (SEM) comprising Energy Dispersive X-ray (EDX) detectors.', '', 'To carry out studies related to morphology, microstructure, chemical composition of samples related to pyrochemical studies, metallic fuel and basic studies containing rare earth cadmium, lithium cadmium, uranium plutonium cadmium, uranium zirconium, uranium plutonium zirconium, uranium aluminium, stainless steel and other related alloys. ', '-', '2', 'No', '', '0', '20', '-', 'No', '', 'PESS/PPED. MC&MFCG. Samples of other groups, research scholars and students are also being carried o', '-', 'No', '-', 'No', '-', 'No', '-', 'No', NULL, '', 'Yes', 'App 4 instruments at IGCAR', '-', 'Researchers from other groups and research scholars can utilise the facility for its maximum utilisation', 'ADMIN', '2022-02-25 09:48:11', 0),
